import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";

const App = () => {
  const [theme, setTheme] = useState("light"); // State for theme

  const toggleTheme = () => {
    setTheme((prevTheme) => (prevTheme === "light" ? "dark" : "light"));
  };

  return (
    <Router>
      <div className={`App ${theme}`}>
        {/* Navigation Bar */}
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
          <div className="container">
            <Link className="navbar-brand" to="/">
              MyApp
            </Link>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
              aria-controls="navbarNav"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse" id="navbarNav">
              <ul className="navbar-nav ms-auto">
                <li className="nav-item">
                  <Link className="nav-link btn btn-link" to="/">
                    Home
                  </Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link btn btn-link" to="/courses">
                    Courses
                  </Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link btn btn-link" to="/contact">
                    Contact
                  </Link>
                </li>
                <li className="nav-item">
                  <Link className="nav-link btn btn-link" to="/account">
                    Account
                  </Link>
                </li>
                <li className="nav-item">
                  <button
                    className="btn btn-outline-light ms-3"
                    onClick={toggleTheme}
                  >
                    Toggle {theme === "light" ? "Dark" : "Light"} Theme
                  </button>
                </li>
              </ul>
            </div>
          </div>
        </nav>

        {/* Routes */}
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/courses" element={<Courses />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/account" element={<Account />} />
        </Routes>
      </div>
    </Router>
  );
};

const Home = () => (
  <div className="container mt-5">
    <h1>Welcome to Our Course Recommendation</h1>
    <p>Explore and find the best courses available.</p>
  </div>
);

const Courses = () => (
  <div className="container mt-5">
    <h1>Courses</h1>
    <p>Here are your recommended courses.</p>
  </div>
);

const Contact = () => (
  <div className="container mt-5">
    <h1>Contact Us</h1>
    <p>Get in touch with us for any queries or support.</p>
  </div>
);

const Account = () => (
  <div className="container mt-5">
    <h1>My Account</h1>
    <p>Manage your account details and preferences.</p>
  </div>
);

export default App;
